import Grid from '@material-ui/core/Grid';
import {useParams} from "react-router-dom";
import Button from '@material-ui/core/Button';


export default function PropertyMiniDetailes() {
    var valll="";

    const{id}=useParams();

    switch(id){
        case "Sale":valll="jai singh rathore Marriage"
        break;
        case "Will":valll="jai singh rathore birth"
        break;
        case "Rent":valll="jai singh rathore de"
        break;
        case "Relinquishment":valll="jai singh rathore"
        break;
        case "Power":valll="jai singh rathore"
        break;
        case "Transfer":valll="jai singh rathore"
        break;
        case "Sale":valll="jai singh rathore"
        break;
        case "Rectification":valll="jai singh rathore"
        break;
        case "Partition":valll="jai singh rathore"
        break;
        case "Conveyance":valll="jai singh rathore"
        break;
        case "Declaration":valll="jai singh rathore"
        break;
        case "Exchange":valll="jai singh rathore"
        break;
        case "Surrender":valll="jai singh rathore"
        break;
        case "Award":valll="jai singh rathore"
        break;
        case "Partition":valll="jai singh rathore"
        break;

        default:var error=`There is no page With the name ${id}`

    }   
    
    
        const[initia,upda]=useState(valll);

    return (
        <>
            <Grid container style={{zIndex:0}}>
            <Grid item xs={12} style={{height:"505px",backgroundImage:`url("https://attorco.themestek.com/demo1/wp-content/uploads/sites/4/2019/06/slider1-02.jpg")`,backgroundSize:"100% 505px",display:"flex",justifyContent:"center",alignItems:"center"}}>
                <div>
            <p className="top linky" style={{}}>Services</p>
            <h1 className="topu">ALL ABOUT {id.toUpperCase()} CERTIFICATE</h1>
                </div>
            </Grid>
            <Grid style={{width: '100%',padding:'82px 50px 0 50px'}} item xs={12} container> 

            <Grid item xs={2}></Grid>

                <Grid item xs={8}>
                <h2 className="services" style={{fontSize:'4rem',textAlign:'center'}}>
                Some Details About Certificate{id}
                </h2>
                {error?
                <>
                <h1 style={{textAlign:'center',color:"red",marginBottom:"20px"}}>{error}</h1>
                <Button variant="outlined" style={{color:"red",borderColor:"#CDBA6D",width:"100px",height:'40px',position:'relative',left:"50%",fontSize:"1.5rem",transform:"translate(-50%)",marginBottom:"20px"}} onClick={window.history.back()}>
        goBack
      </Button>
                </>:""}
                <p>
                    {initia}
                </p>
                </Grid>

                <Grid item xs={2}></Grid>

            </Grid>
            </Grid>  

        </>
    )
}
